import React from "react";
import { Container, Row, Col, Breadcrumb } from "react-bootstrap";
export const TicketLists = () => {
  return (
    <Container>
      <Row>
        <Col>
          <Breadcrumb page="Ticket List" />
        </Col>
      </Row>
    </Container>
  );
};
